function divideRoom(roomDatas) {
  let count = 0;
  let swiper = [];
  let swiperSlide;
  for (const roomData of roomDatas) {
    swiperSlide = [];
    if (count >= roomData.length) {
      swiper.push(swiperSlide);
      return swiper;
    }
    for (let i = 0; i < ROOM_COUNT; i++) {
      if (count >= roomDatas.length) {
        swiper.push(swiperSlide);
        return swiper;
      }
      swiperSlide.push(
        <Board to="/" key={String(i) + String(roomData.room_id)}>
          <BoardImage $thumbnail={roomData.thumbnail}></BoardImage>
          <RightRoomBox>
            <BoardTitle>{roomData.title + '  ' + roomData.room_id}</BoardTitle>
            <LowerRoomBox>
              <BoardTags>
                {roomData.tags.map((tag, idx) => {
                  return <Tag key={idx}>{'#' + tag}</Tag>;
                })}
              </BoardTags>
              <UserCount>
                {String(roomData.present_users) +
                  '/' +
                  String(roomData.expected_users)}
              </UserCount>
            </LowerRoomBox>
          </RightRoomBox>
        </Board>
      );
      count++;
    }
    swiper.push(<StyledSwiperSlide>{swiperSlide}</StyledSwiperSlide>);
  }
}
export default tempRoomDatas;
